let state = {
  profile: {
    postData: [
      {
        names: "Danny",
        id: 0,
        message: "Hi, bird, how are you?!",
        likeCount: "15",
      },
      { names: "Danny", id: 1, message: "Lets fire", likeCount: "10" },
      { names: "Danny", id: 2, message: "U smell like sheep", likeCount: "7" },
      { names: "Danny", id: 3, message: "Hi bro", likeCount: "2" },
    ],
  },
  dialogs: {
    dialogsData: [
      { id: 0, name: "Jimmy" },
      { id: 1, name: "Bobby" },
      { id: 2, name: "Tommy" },
      { id: 3, name: "Katrin" },
      { id: 4, name: "Victoria" },
    ],

    messagesData: [
      { id: 0, text: "HI!" },
      { id: 1, text: "nice" },
      { id: 2, text: "good" },
      { id: 3, text: "bye" },
      { id: 4, text: "lets start" },
    ],
  },
};

export let rerenderEntireTree = () => {
  ReactDOM.render(
    <React.StrictMode>
      <BrowserRouter>
        <App state={state} addPost={addPost} />
      </BrowserRouter>
    </React.StrictMode>,
    document.getElementById("root")
  );
};

export let addPost = (postMessage) => {
  let newPost = {
    id: 5,
    message: postMessage,
    likeCount: 0,
  };

  state.profile.postData.push(newPost);
  rerenderEntireTree();
};

export default state;
